<main class="main">
    <section class="menu">
        <div class="container">
            <div class="menu-wrapper">
                <ul class="menu-menu">
                    <li class="menu-menu__item">
                        <a href="/user/profile" class="menu-menu__link active">
                            Мой профиль
                        </a>
                    </li>
                    <li class="menu-menu__item">
                        <a href="/service/user/organizations" class="menu-menu__link">
                            Мои организации
                        </a>
                    </li>
                    <li class="menu-menu__item">
                        <a href="/service/user/feedbacks" class="menu-menu__link">
                            Мои отзывы
                        </a>
                    </li>
                    <li class="menu-menu__item">
                        <a href="/service/user/favourites" class="menu-menu__link">
                            Избранное
                        </a>
                    </li>
                </ul>
            </div>
        </div>
    </section>

    <section class="profile">
        <form class="container" method="post" enctype="multipart/form-data">
            <input type="hidden" name="profile" value="1">
            <div class="profile-wrapper">
                <div class="profile-item">
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Фамилия:</label>
                        <input type="text" name="surname" value="Нестеров" class="profile-group__input">
                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Имя:</label>
                        <input type="text" name="name" value="Максим" class="profile-group__input">
                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Отчество:</label>
                        <input type="text" name="patron" value="" class="profile-group__input">
                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Привязать соц. сети:</label>
                        <div class="profile-group__social">
                            <script src="//ulogin.ru/js/ulogin.js"></script>
                            <a href="" class="footer-social__link lk-social__link" onclick="window.open(&quot;https://ulogin.ru/auth.php?name=vkontakte&amp;window=1&amp;lang=ru&amp;fields=photo,first_name,last_name&amp;force_fields=&amp;popup_css=&amp;host=in-scale.ru&amp;optional=&amp;redirect_uri=https%3A%2F%2Fin-scale.ru/service/user&amp;verify=&amp;callback=&amp;screen=1920x1080&amp;url=&amp;providers=vkontakte,facebook&amp;hidden=&amp;m=0&amp;page=https%3A%2F%2Fin-scale.ru%2Fservice%2F&amp;icons_32=&amp;icons_16=&amp;theme=classic&amp;client=&amp;version=3&quot;,&quot;uLogin_window&quot;, &quot;width=500,height=400,left=20,top=20&quot;);return false;">

                                <svg class="footer-social__icon" width="50" height="28">
                                    <use xlink:href="/service/svg-symbols.svg#logo-vk"></use>
                                </svg>

                            </a>
                            <a href="" class="footer-social__link lk-social__link" onclick="window.open(&quot;https://ulogin.ru/auth.php?name=facebook&amp;window=1&amp;lang=ru&amp;fields=photo,first_name,last_name&amp;force_fields=&amp;popup_css=&amp;host=in-scale.ru&amp;optional=&amp;redirect_uri=https%3A%2F%2Fin-scale.ru/service/user&amp;verify=&amp;callback=&amp;screen=1920x1080&amp;url=&amp;providers=vkontakte,facebook&amp;hidden=&amp;m=0&amp;page=https%3A%2F%2Fin-scale.ru%2Fservice%2F&amp;icons_32=&amp;icons_16=&amp;theme=classic&amp;client=&amp;version=3&quot;,&quot;uLogin_window&quot;, &quot;width=500,height=400,left=20,top=20&quot;);return false;">

                                <svg class="footer-social__icon" width="26" height="52">
                                    <use xlink:href="/service/svg-symbols.svg#logo-fb"></use>
                                </svg>

                            </a>
                        </div>
                    </div>
                </div>
                <div class="profile-item">
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Телефон:</label>
                        <input type="text" name="phone" value="" class="profile-group__input">
                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Эл. почта:</label>
                        <input type="text" name="email" value="nimpweb@yandex.ru" class="profile-group__input">
                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Пол:</label>
                        <div class="profile-group__radio">
                            <input type="radio" id="radio-1" name="meta[Пол]" value="1" class="profile-group__area visually-hidden">
                            <label for="radio-1">Мужской</label>
                            <input type="radio" id="radio-2" name="meta[Пол]" value="0" class="profile-group__area visually-hidden">
                            <label for="radio-2">Женский</label>
                        </div>
                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Дата рождения:</label>
                        <div class="profile-group__date">
                            <input type="text" name="meta[День рождения]" class="profile-group__input profile-group__day" value="">
                            <select name="meta[Месяц рождения]" id="" class="profile-group__select profile-group__month">
                                <option>янв</option>
                                <option>фев</option>
                                <option>март</option>
                                <option>апр</option>
                                <option>май</option>
                                <option>июнь</option>
                                <option>июль</option>
                                <option>авг</option>
                                <option>сент</option>
                                <option>окт</option>
                                <option>нояб</option>
                                <option>дек</option>

                            </select>
                            <input type="text" name="meta[Год рождения]" class="profile-group__input profile-group__year" value="">
                        </div>
                    </div>
                </div>
                <div class="profile-item">
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Сфера деятельности:</label>
                        <select name="meta[Сфера деятельности]" id="spheres" class="profile-group__select">
                            <option disabled="" selected="">Выберите сферу</option>
                            <option>Товары</option>
                            <option>Услуги</option>

                        </select>
                    </div>
                    <div class="profile-group" id="spheres-input">
                        <label for="" class="profile-group__label">Введите сферу деятельности:</label>
                        <input type="text" name="company" value="" class="profile-group__input">
                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Название компании:</label>
                        <input type="text" name="company" value="" class="profile-group__input">
                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Размер компании:</label>
                        <input type="text" name="meta[Размер компании]" value="" class="profile-group__input">

                    </div>
                    <div class="profile-group">
                        <label for="" class="profile-group__label">Ваше фото:</label>
                        <div class="profile-group__img-block">
                            <img src="data:image/jpeg;base64," alt="" class="profile-group__img">
                            <input type="file" name="image" id="file" class="profile-group__input-file">
                            <label for="file" class="profile-group__label-file">Загрузить фото</label>
                        </div>
                    </div>
                </div>
            </div>
            <div class="profile-center">			<div>				<a href="/service/user/edit" class="profile-center__link">Изменить пароль</a>				<a href="/service/user/logout" class="profile-center__link">Выйти</a>
                </div>
                <button class="profile-center__button" id="save-user">Сохранить изменения</button>
            </div>
        </form>
    </section>
</main>